import React from "react";

export const Forms = () => {

    return (
        <div>
            <form>
            <label for="title">Title:</label><br></br>
            <input type="text" placeholder="Enter Title" />
            <label for="url">Url:</label><br></br>
            <input type="text" placeholder="Enter Url" />
            </form>
            
            
        </div>
    )
}
